measurements.description:
Three flowers on one 15-cm inflorescence;
	flowers green overlaid dusty rose-bronze; sepals spotted dark purple, more concentrated on lateral sepals;
	petals heavily spotted dark purple; reverse of flower heavly spotted dark purple;

	 lip white, side lobes yellow centrally blushed pink, ruffled midlobe flushed bright magenta;

    substance very firm; texture waxy, lip diamond dust.
